import React, { useEffect, useState } from 'react'

function DataFetching() {
    const [posts, setPosts] = useState([]);

    useEffect(()=>{
        axios.get('https://jsonplaceholder.typicode.com/posts')
             .then(res => {
                 console.log(res)

             })
             .catch(err => {
                 console.log(err)
             })
    })
    return (
        <div>
            <ul>
                {
                    posts.map(post => (
                        <li key={post.id}>{post.title}</li>)
                    )}
            </ul>
        </div>
    )
}

export default DataFetching
